This master of emotion covers her eyes when she summons her Doppel. She cannot look at its form without giggling to herself, although she knows it doesn’t truly represent what she thinks of when she sees it.

The Doppel lets hatchets fly to protect the ones its master loves. It won’t let its master enter the darkest depths ever again. If the master’s loved ones come to harm it could have prevented, its master’s neck will never heal from using its power.
